  false,\n\t\"url\": null,\n\t\"notes\": \"Twelve quadrats were sampled along 2 consecutively-placed,
  25m transect lines, as part of Rapid Ecological Assessments, conducted at 12 sites
  at Maui in the Main Hawaiian Islands from July 27 - August 20 2006, aboard the NOAA
  ship Hi'ialakai, during the Reef Assessment and Monitoring Program (RAMP) Cruise
  HI0610. Raw survey data included genus presence and relative abundance, and voucher
  specimens. Detailed taxonomic analyses of voucher specimens are presented.\",\n\t\"owner_org\":
